import React from 'react';
import PropTypes from 'prop-types'

class Login extends React.Component {
  render() {
    return (
      <nav className="login">
        <h2>Inventory Login</h2>
      </nav>
    );
  }
}

Login.propTypes = {
  tagline: PropTypes.string.isRequired
}

export default Login;
